import { createSelector } from "reselect";

const selectBirds = (state) => state.birds;

export const selectBirdsFirstPage = createSelector(
  [selectBirds],
  (birds) => birds.birdsFirstPage
);

export const selectBirdsSecondPage = createSelector(
  [selectBirds],
  (birds) => birds.birdsSecondPage
);

export const selectBirdsThirdPage = createSelector(
  [selectBirds],
  (birds) => birds.birdsThirdPage
);

export const selectBirdsFourPage = createSelector(
  [selectBirds],
  (birds) => birds.birdsFourPage
);

export const selectBirdsFivePage = createSelector(
  [selectBirds],
  (birds) => birds.birdsFivePage
);

export const selectBirdsSixPage = createSelector(
  [selectBirds],
  (birds) => birds.birdsSixPage
);

export const selectBirdsNames = createSelector(
  [selectBirds],
  (birds) => birds.birdsNames
);
